class Solution:
    def partion(self,l,r):
        i = l
        while l < r:
            while self.arr[r] >= self.arr[i]:
                if l == r :
                    break
                r -= 1
            self.arr[r], self.arr[i] = self.arr[i], self.arr[r]
            i = r

            while self.arr[l] <= self.arr[i]:
                if l == r :
                    break
                l += 1
            self.arr[l], self.arr[i] = self.arr[i], self.arr[l]
            i = l
        return i
    def quicksort(self,l,r):
        if l == r: return l+1
        i = self.partion(l,r)
        self.quicksort(l,i)
        self.quicksort(i+1,r)
    def smallestK(self, arr, k: int):
        self.arr = arr
        self.quicksort(0,len(arr)-1)
        return self.arr
